import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100%;

  div{
    background-color: red;

    form{

      div{
        background-color: green;
        input{
          background-color: purple;
          height: 20 !important;
        }
      }

    }

  }

`;
